var app=angular.module("main.filters",[]);app.filter("convertDate",function(){return function(a,c){var b=[];b.push(a.date);b.push(a.time);b.push(c);return new Date(b.join(" "))}});app.filter("dateMillis",function(a){return function(b,c){return a("convertDate")(b,c).getTime()}});app.filter("confStartDate",function(a){return function(b,d){var c=a("convertDate")(b.date.startDate,b.date.timezone);return a("date")(c,d)}});app.filter("confEndDate",function(a){return function(b,d){var c=a("convertDate")(b.date.endDate,b.date.timezone);return a("date")(c,d)}});